import React from "react";
import "./Header.css";
export const Header = (props) => {
  return (
    <header id="header">
      <div className="intro">
        <div className="overlay">
          <div className="container">
            <div className="row">
              <div className="col-md-8 col-md-offset-2 intro-text">
                <h1>

                  {/* <br /> */}
                  {/* {props.data ? props.data.title : ""} */}

                </h1>
                <p>    <p>Welcome </p>{props.data ? props.data.paragraph : ""}</p>
              </div>
            </div>
            <div className="row fact-box-container">
              <div className="fact-box col-md-3">
                {/* <h3>Fact 1</h3> */}
                <p>Over 25% of business data is inaccurate or incomplete, impacting decision-making.</p>
              </div>
              <div className="fact-box col-md-3">
                {/* <h3>Fact 2</h3> */}
                <p>Data cleansing can increase data usability by up to 80%!</p>
              </div>
              <div className="fact-box col-md-3">
                {/* <h3>Fact 3</h3> */}
                <p>Dirty data costs businesses trillions of dollars annually.</p>
              </div>
              <div className="fact-box col-md-3">
                {/* <h3>Fact 4</h3> */}
                <p>Proper data cleansing ensures accurate predictions in AI models.</p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </header>
  );
};



